Web Workers are a browser API that allows you to run JavaScript code in background threads, separate from the main UI thread. This enables true parallel processing in web applications.

## Key Benefits

- **Non-blocking execution**: Heavy computations won't freeze the user interface
- **True parallelism**: Code runs simultaneously with the main thread
- **Better performance**: CPU-intensive tasks can be offloaded from the main thread

## Types of Web Workers

### 1. Dedicated Workers
Run in their own global context and are linked to a single script.

**Main thread (main.js):**
```javascript
// Create a new worker
const worker = new Worker('worker.js');

// Send data to worker
worker.postMessage({ command: 'start', data: [1, 2, 3, 4, 5] });

// Listen for messages from worker
worker.addEventListener('message', function(e) {
    console.log('Result from worker:', e.data);
});

// Handle errors
worker.addEventListener('error', function(e) {
    console.error('Worker error:', e);
});
```

**Worker thread (worker.js):**
```javascript
// Listen for messages from main thread
self.addEventListener('message', function(e) {
    const { command, data } = e.data;

    if (command === 'start') {
        // Perform heavy computation
        const result = data.map(num => num * num).reduce((a, b) => a + b, 0);

        // Send result back to main thread
        self.postMessage(result);
    }
});
```

### 2. Shared Workers
Can be accessed by multiple scripts running in different windows/tabs.

```javascript
// Create or connect to shared worker
const worker = new SharedWorker('shared-worker.js');

// Communicate through the port
worker.port.postMessage('Hello from tab 1');
worker.port.onmessage = function(e) {
    console.log(e.data);
};
```

## Practical Use Cases

### 1. Data Processing
```javascript
// worker.js - Processing large datasets
self.onmessage = function(e) {
    const data = e.data;

    // Heavy data processing
    const processed = data
        .filter(item => item.active)
        .map(item => ({
            ...item,
            processed: true,
            timestamp: Date.now()
        }))
        .sort((a, b) => a.priority - b.priority);

    self.postMessage(processed);
};
```

